# from dataset_9_4.txt
TEXT = ''
PATTERN = 'TGCAACTAA'
D = 4

def print_num_list_as_str(numlist, glue=' '):
    print(glue.join(str(x) for x in numlist))

def hamming_distance(text1, text2):
    if len(text1) != len(text2):
        return -1
    return sum([0 if text1[i] == text2[i] else 1 for i in range(len(text1))])

def get_approx_kmers(text, pattern, d):
    k = len(pattern)
    return [i for i in range(len(text)-k+1) if hamming_distance(text[i:i+k], pattern) <= d]

ans = get_approx_kmers(TEXT, PATTERN, D)
print_num_list_as_str(ans)

